import React, { useState } from 'react';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button, Col
} from 'reactstrap';

import './style.css';

const Content = () =>{

    return (
      <Col xs="6" >
        <Card className="card">
          <CardImg top width="100%" src="/assets/318x180.svg" alt="Card image cap" className="cardImg"/>
          <CardBody className="cardBody">
            <CardTitle className="cardTitle">Card title</CardTitle>
            <CardSubtitle className="cardSubTitle">Card subtitle</CardSubtitle>
            <a className="cardButton">Button</a>
          </CardBody>
        </Card>
      </Col>
    )
}

export default Content;
